import React from 'react';

class NavBar extends React.Component {
    render() {
        return (
            <div className="navigation">
                <ul>
                    <li>
                        <a >
                            <span className="icon"></span>
                            <span className="title"></span>
                        </a>
                    </li>
                </ul>
            </div>
        )
    }
}

export default NavBar;
